    false,nt"url": null,nt"notes": "This data set describes observation wells
    completed in the Arikaree aquifer that were used to create a map of the generalized
    potentiometric surface of the Arikaree aquifer in the Pine Ridge Indian Reservation
    and Bennett County. The observation wells are owned by the South Dakota Department
    of Environment and Natural Resources. Water levels in the wells were measured by
    staff of the South Dakota Department of Environment and Natural Resources. The water-level
    data for this data set are based on the average of measured values for the well
    from completion through 2005. The range in water-level data for this data set was
    from 1977 to 2005. All water levels were retrieved from the U.S. Geological Survey's
    NWISWeb database at http://nwis.waterdata.usgs.gov/sd/nwis/gwlevels.",nt"license_title":
